import React from 'react';

const AboutSection = () => {
  return (
    <section id="about" className="section">
      <h2>About Fashion Muse</h2>
      <p>
        Fashion Muse is your one-stop platform for personalized styling,
        outfit recommendations, and real-time AI assistance. Whether it's
        everyday wear or special occasions, we've got you covered.
      </p>
    </section>
  );
};

export default AboutSection;
